import logo from './logo.svg';
import './App.css';
import {useState} from 'react';

const boxes = [1, 2, 3, 4, 5, 6, 7, 8, 9];

function App() {
  return (
    <>
      <div>
        <table>
          {boxes.map(box => {
            if (box in [1, 4, 7])
            return (
              <td key={box}>{box}</td>
            )
          })}
          <tr>
            <td>1</td>
            <td>2</td>
            <td>3</td>
          </tr>
          <tr>
            <td>4</td>
            <td>5</td>
            <td>6</td>
          </tr>
          <tr>
            <td>7</td>
            <td>8</td>
            <td>9</td>
          </tr>
      </table>
      </div>

    </>
  );
}

export default App;
